import React from 'react';

function App() {

  const getFetch = async () => {
    const data = await "http://localhost:8080/sign/all";
    fetch(data)
      .then(result => {
        console.log(result.json());
      })
      .catch(err => console.log(err));
  }

  getFetch();

  return (
    <div>
      App
    </div>
  )
}

export default App
